import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as t,e as c}from"./app-457d8571.js";const d={},a=c('<h1 id="简介" tabindex="-1"><a class="header-anchor" href="#简介" aria-hidden="true">#</a> 简介</h1><p>什么叫做计算属性,计算属性就是非简单的包装类型或者基本类型，比如： 估顾名思义这个属性是通过转换函数或者计算得出的属性</p><ul><li><code>json</code>属性<code>private UserExtra userExtra;</code>用来描述数据库存储的字符串或者json类型,映射到java的对象上,支持筛选,返回排序等</li><li><code>集合</code>属性<code>private List&lt;UserLabels&gt; userLabels;</code>用来描述数据库存储的字符串或者json类型,映射到java的集合上,支持筛选,返回排序等</li><li>枚举属性<code>private UserStatusEnum userStatus;</code>用来描述数据库存储的字符串或者数字类型,映射到java的枚举属性,支持筛选,返回排序等</li><li>增强属性<code>private String idCard;</code>写入数据库时会自动添加<code>base64</code>编码读取会自动进行解码,支持筛选,返回排序等</li><li>简单计算属性:复合属性<code>private String fullName;</code>他是有<code>firstName</code>和<code>lastName</code>组合，再比如年龄,他是由当前时间和生日的相减生成的动态值,支持筛选,返回排序等</li><li>复杂计算属性:由子表或者额外表数据构成,比如<code>private Integer StudentSize;</code>加入班级和用户是一对多,那么这个属性用来描述班级下有多少学生人数,支持筛选排序返回</li><li>函数自增属性:该属性可以做到数据由数据库生成比如数据库函数存在<code>mysqlNextId()</code>或者<code>gis</code>中由数据库生成的函数那么适用于改方法仅插入时生效</li></ul>',3),i=[a];function r(s,l){return o(),t("div",null,i)}const _=e(d,[["render",r],["__file","index.html.vue"]]);export{_ as default};
